// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DrugTraceability {
    struct Drug {
        uint256 id;
        string name;
        string manufacturer;
        string batchNumber;
        address currentOwner;
    }

    mapping(uint256 => Drug) public drugs;

    event DrugRegistered(uint256 id, string name, address indexed manufacturer);
    event DrugOwnershipTransferred(uint256 id, address indexed from, address indexed to);

    modifier onlyOwner(uint256 _id) {
        require(drugs[_id].currentOwner == msg.sender, "Not the owner");
        _;
    }

    function registerDrug(
        uint256 _id,
        string memory _name,
        string memory _manufacturer,
        string memory _batchNumber
    ) public {
        require(drugs[_id].id == 0, "Drug ID already exists");

        drugs[_id] = Drug({
            id: _id,
            name: _name,
            manufacturer: _manufacturer,
            batchNumber: _batchNumber,
            currentOwner: msg.sender
        });

        emit DrugRegistered(_id, _name, msg.sender);
    }

    function transferOwnership(uint256 _id, address _newOwner) public onlyOwner(_id) {
        require(_newOwner != address(0), "Invalid address");
        address previousOwner = drugs[_id].currentOwner;
        drugs[_id].currentOwner = _newOwner;

        emit DrugOwnershipTransferred(_id, previousOwner, _newOwner);
    }

    function getDrugDetails(uint256 _id)
        public
        view
        returns (
            string memory name,
            string memory manufacturer,
            string memory batchNumber,
            address currentOwner
        )
    {
        Drug memory drug = drugs[_id];
        require(drug.id != 0, "Drug not found");
        return (
            drug.name,
            drug.manufacturer,
            drug.batchNumber,
            drug.currentOwner
        );
    }
}
